import React from 'react';
import ArticleList from './ArticleList.js';

function Home() {
	const containerClass = 'container__home';
	return (
		<div className={"container " + containerClass}>
			<div className="row">
				<ArticleList />
			</div>
		</div>
	);
}

export default Home;
